import React, { useState } from 'react';
import './App.css';
import InputField from './components/InputField';

const App: React.FC = () =>  {
  const [tasks, setTasks] = useState<string>("")

  return (
    <div>
      <span className='heading'>Taskify</span>
      <InputField tasks={tasks} setTasks={setTasks} />
    </div>
  );
}

export default App;
